import React from 'react';
import {Redirect, Route, Routes} from "react-router";
import "../index.css"
import Login from "../components/login";

const RoutesComponent = () => {

    return (
        <Routes>
            <Route path="/" element={<Login/>}/>
            <Redirect to="/"/>
        </Routes>
    )
}

export default RoutesComponent;
